import React from 'react';


var SignInForm = (props) => {

    var handleInputChange = (event) => {
        console.log(event.target.id);
        console.log(event.target.value);
    }

    return (
        <form>
            <label>
                Name: 
                <br /> 
                <textarea id='name' rows='1' cols='20' onChange={handleInputChange}/>
            </label>
            <br/>
            <br/>
            <label>
                Email:
                <br/> 
                <textarea id='email' rows='1' cols='20' onChange={handleInputChange}/>
            </label>
            <br />
            <br />
            <label>
                Password: 
                <br/> 
                <textarea id='password' rows='1' cols='20' onChange={handleInputChange}/>
            </label>
            <br/>
            <br/>
            <button>SUBMIT</button>
        </form>
    );

}

export default SignInForm;
